            </p>
          </li>
          <li>
            <p>06374 Ostim Osb/Yenimahalle/Ankara</p>
          </li>
          <li>
            <p>+903123857693</p>
          </li>
          <li>
            {" "}
            <p>info@symakina.com</p>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Footerr;
